import React from "react";
import Header from "./Header";

function Home() {
  return (
    <div className="signup-page">
        <Header />
        <div className="banner">
        <h1 className="banner-title">사내 ERP 프로젝트, CoreOne</h1>
      </div>
    </div>
  );
}

export default Home;
